var certificateModule = (function () {
  return {
    generateCertificate: function (data) {
      var imgData =
        "data:image/png;base64,";
      var doc = new jsPDF();
      doc.addImage(imgData, "png", 15, 40, 180, 140);

      // adding title
      doc.setFont("times");
      doc.setFontType("italic");
      doc.setTextColor(0, 86, 145);
      doc.setFontSize(21);
      doc.text(105, 68, "TYPING SPEED CERTIFICATE", "center");

      // adding text
      doc.setTextColor(0, 0, 0);
      doc.setFontSize(14);
      doc.setFontType("normal");
      doc.text(105, 80, "This certificate is hereby Awarded to :", "center");

      // adding name
      var button = document.getElementById("download");
      var nameField =
        button.parentElement.previousElementSibling.children[1].children[0];

      var name = nameField.value;
      doc.setTextColor(0, 86, 145);
      doc.setFontSize(18);
      doc.text(105, 89, name, "center");

      // add text
      doc.setTextColor(0, 0, 0);
      doc.setFontSize(14);
      doc.setFontType("normal");
      doc.text(
        105,
        100,
        "For Achieving Results noted below as documented",
        "center"
      );
      doc.text(105, 106, "and verified by Typing Test Cell", "center");

      // add results
      var level = event.target.getAttribute("level");
      doc.text(105, 116, "Level : " + level, "center");
      doc.text(105, 124, "Average Speed : " + data.wpm + " wpm", "center");
      doc.text(105, 132, "Accuracy : " + data.accuracy + " %", "center");

      // add date
      var date = new Date();
      date = date.toLocaleDateString("en-GB");
      doc.text(120, 150, "Awarded on " + date);
      // add brand
      doc.text(120, 158, "Typing Test Cell");

      doc.save("certificate.pdf");
    },
  };
})();
